summaryDoc.doc:
Returns a function that when called, calls-back with the values provided.
Useful as the first function in a [`waterfall`](async/ControlFlow.waterfall), or for plugging values in to
[`auto`](async/ControlFlow.auto).


### Example
```javascript
invokes the callback with the previous given arguments.

async.waterfall([
    async.constant(42),
    function (value, next) {
        // value === 42
    },
    //...
], callback);

async.waterfall([
    async.constant(filename, "utf8"),
    fs.readFile,
    function (fileData, next) {
        //...
    }
    //...
], callback);

async.auto({
    hostname: async.constant("https://server.net/"),
    port: findFreePort,
    launchServer: ["hostname", "port", function (options, cb) {
        startServer(options, cb);
    }],
    //...
}, callback);

```

